import React from "react";

const LeaderboardUser = ({ userData }, map) => {
  console.log(userData);
  return (
    <div className="LeaderboardUser">
      <p>{userData.displayName}</p>
      <p>{`Score: ${map}`}</p>
    </div>
  );
};

export default LeaderboardUser;
